import React from "react";
import { View , Text , Image} from "react-native";

const UserCard = (props) => {
    return(
        <View>
            <Image />
            <Text>Name : {}</Text>
            <Text>Phone Number</Text>
            <Text>Address</Text>
            <Text>Gender {props.UserData.gender}</Text>
        </View>
    );
}

export default UserCard;
